import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  Box,
  Container,
} from '@mui/material';
import { Menu as MenuIcon, Close as CloseIcon } from '@mui/icons-material';

export default function Navbar({ scrollToSection }) {
  const [mobileOpen, setMobileOpen] = useState(false);
  const location = useLocation();
  const isHomePage = location.pathname === '/';

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const handleNavClick = (item) => {
    if (isHomePage && scrollToSection) {
      if (item.text === 'About') {
        scrollToSection('about');
        return;
      }
      if (item.text === 'Skills') {
        scrollToSection('skills');
        return;
      }
    }
    // For non-homepage or other items, use regular navigation
    return item.path;
  };

  const menuItems = [
    { text: 'Home', path: '/' },
    { text: 'About', path: '/about' },
    { text: 'Skills', path: '/skills' },
    { text: 'Projects', path: '/projects' },
    { text: 'Contact', path: '/contact' },
  ];

  const drawer = (
    <Box sx={{ width: 250, pt: 2 }}>
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', px: 2, pb: 2 }}>
        <IconButton onClick={handleDrawerToggle}>
          <CloseIcon />
        </IconButton>
      </Box>
      <List>
        {menuItems.map((item) => {
          const shouldUseScroll = isHomePage && scrollToSection && (item.text === 'About' || item.text === 'Skills');

          return (
            <ListItem key={item.text} disablePadding>
              <Button
                component={shouldUseScroll ? 'button' : Link}
                to={shouldUseScroll ? undefined : item.path}
                fullWidth
                onClick={() => {
                  handleDrawerToggle();
                  if (shouldUseScroll) {
                    handleNavClick(item);
                  }
                }}
                sx={{
                  justifyContent: 'flex-start',
                  px: 3,
                  py: 1.5,
                  color: 'text.primary',
                  textTransform: 'none',
                  fontSize: '1.1rem',
                }}
              >
                {item.text}
              </Button>
            </ListItem>
          );
        })}
      </List>
    </Box>
  );

  return (
    <>
      <AppBar 
        position="fixed" 
        sx={{ 
          backgroundColor: 'rgba(15, 1, 52, 0.9)',
          backdropFilter: 'blur(10px)',
          boxShadow: '0 4px 20px rgba(0, 0, 0, 0.3)',
        }}
      >
        <Container maxWidth="lg">
          <Toolbar>
            <Typography
              variant="h6"
              component={Link}
              to="/"
              sx={{
                flexGrow: 1,
                textDecoration: 'none',
                color: 'inherit',
                fontWeight: 700,
                fontSize: '1.5rem',
              }}
            >
              Janidu Peiris
            </Typography>

            {/* Desktop Menu */}
            <Box sx={{ display: { xs: 'none', md: 'flex' }, gap: 1 }}>
              {menuItems.map((item) => {
                const shouldUseScroll = isHomePage && scrollToSection && (item.text === 'About' || item.text === 'Skills');

                return (
                  <Button
                    key={item.text}
                    component={shouldUseScroll ? 'button' : Link}
                    to={shouldUseScroll ? undefined : item.path}
                    onClick={shouldUseScroll ? () => handleNavClick(item) : undefined}
                    sx={{
                      color: 'white',
                      textTransform: 'none',
                      fontSize: '1rem',
                      px: 2,
                      '&:hover': {
                        backgroundColor: 'rgba(187, 134, 252, 0.1)',
                      },
                    }}
                  >
                    {item.text}
                  </Button>
                );
              })}
            </Box>

            {/* Mobile Menu Button */}
            <IconButton
              color="inherit"
              edge="start"
              onClick={handleDrawerToggle}
              sx={{ display: { md: 'none' } }}
            >
              <MenuIcon />
            </IconButton>
          </Toolbar>
        </Container>
      </AppBar>

      {/* Mobile Drawer */}
      <Drawer
        variant="temporary"
        anchor="top"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true,
        }}
        sx={{
          display: { xs: 'block', md: 'none' },
          '& .MuiDrawer-paper': {
            backgroundColor: 'background.paper',
            backdropFilter: 'blur(10px)',
          },
        }}
      >
        {drawer}
      </Drawer>

      {/* Spacer for fixed navbar */}
      <Toolbar />
    </>
  );
}
